INSERT INTO `faq` VALUES (1,11,'Each week the picks will automatically lock 5 minutes before it\'s kickoff time. All times on this site are central.','When are picks due each week?','POT_RULES'),(2,0,'The lines will be based on that published by various sports web sites such as ESPN. Some services post lines on some games at different times so the source may change in a given week in order to get the line posted as soon as possible. If a particular game has not been assigned a line and a line cannot be found from another published source, then the game will be a pick \'em i.e. no line. This usually happens if it is uncertain if a significant player will be playing in the game.','How are game lines determined?','POT_RULES'),(4,10,'There will be a first and second place winner for each of the regular 17 week season. The player who picks the most correct games each week, considering the line, will win $510. The player who picks the second most correct games each week, considering the line, will win $223. In case of a tie on the number of correct picks the tie-breaker will be the closest prediction of the total points scored in the designated tie-breaker game. No distinction will be made on the total points estimated being over or under the actual total points scored. If there is still a tie, the pot for that week will be split among those that tied.','How are weekly winners determined?','POT_RULES'),(5,4,'The Wildcard, Divisional, and Conference Championship Playoffs consist of 10 games. These 10 games will be played over a three week period but will comprise one week for Pick \'Em (Week 18). The payout for this week will be the same as the other weeks of the regular season. The tie breaker point prediction game will be either the National or American Conference Championship game to be determined when the lines are posted for those games.\n\nThe Super Bowl will pay $1,000 to first place and $500 to second place. Since the Super Bowl is only one game, there will certainly be many that pick the winner. This may require more than one tie breaker. The first tie breaker will be the point prediction that has been used throughout the season. The second tie breaker will the closest prediction of total offensive yards gained (both teams combined). Often this changes from what is indicated right after the game is over by post game shows. So if the tie breaker comes to that, the actual winner will not be officially announced until the final statistics are published. This should be known however within a day or so after the game. When the line is posted for the Super Bowl, there will be some statistical guidance provided for both teams similar to the posting of the Over/Under points each week with the posting of the lines. If a third tie breaker is needed, it will be the best record of tie breaker point predictions for the entire season through the Super Bowl. The current standings of this for all players can be seen in the Home page \"OU Diff\" column. The lowest number represents the season leader.','Playoffs and Super Bowl','POT_RULES'),(6,6,'At the end of the season, which will run through the Super Bowl, the main bonus pool will be paid out to the three players who had the first, second, and third most total correct picks during the season. This payout will be $1,000, $500, and $250, respectively.\n\nThere is a second bonus pot to allow those who fall too far behind for the main bonus to still have a realistic chance to win some bonus money. Starting with week 15, a second running total of correct picks will begin and will run through the Super Bowl. Everyone will start over at 0 picks for this second pot. The main pot continues as usual. The prize for this is $500 and is awarded to the one with the most correct picks from Week 15 through the Super Bowl. Click on the Second Pot link to monitor the standings.\n\nIn the case where there is a tie for the Main bonus pool, it will be handled in the same way prize money is paid out on the PGA Tour. This is best explained by example...If there is a two way tie for first, the first and second place money will be totaled and split 50/50. Then third place money would go to the lone person that would be in third place or split as above if there was a tie for third. If there is a three way or more tie for first, the first, second, and third place money will be added up and split equally among those tied. If this were the scenario then the only players that would receive bonus money would be those three that tied for first. The same scenario would apply if there was a sole player in first then a tie for second or third.\n\nIf there is a tie in the Second pool, the amount is simply divided among those that tied.\n','What is the payout at the end of the season?','POT_RULES'),(8,0,'Please access the home page where players will be ranked according to their number of correct picks for the season.','How can I see the overall standings?','POT_RULES'),(9,0,'One game each week will be established as the \"tie-breaker\" matchup. There will be an associated \"over/under\" indicated which is the projected combined total points scored by both teams in that game. Each player must make their own prediction as to the total points that will be scored in that game. The over/under is only shown for guidance. The tie-breaker point prediction can be entered in factors of half points. (ie: If the predicted over/under is 40, possible picks are 35, 35.5, 36, 36.5 and so on.)','What is Over/Under?','POT_RULES'),(10,0,'If you miss any picks for a given week, you will receive the selection which matches what you\'ve chosen as your default picks in your account settings page. If you have not chosen a default, your pick will be the underdog for the game(s) you missed.\r\n\r\nPicks lock 5 minutes before the first game on the same day of that pick. For example, All Sunday games lock before the first game(s) on Sunday which are usually at noon.','What happens if I miss one or more picks in a week?','POT_RULES'),(11,2,'Use this page to view the list of players ranked according to their number of correct picks for the season. You can also click on any name to view their picks for any locked week.','What is the home page for?','SITE_HELP'),(12,0,'Use this page to make your weekly picks and view your picks from previous weeks. You make your picks by choosing the radio button next to the team you wish to pick against the spread. Please note the legend at the bottom of the page which explains what the various colors mean. You must click the \"Submit\" button to save your picks. The line for each game is with respect to the home team.','What is the My Picks page for?','SITE_HELP'),(13,0,'Access the \"My Picks\" page. You can change your picks as often as you want up to 5 minutes before the first game of any day which, for some weeks, may be on Thursday. Do not forget to click the submit button and make sure that you see the message that your picks were submitted. Any messages returned will be above the picks table.','How can I edit my picks?','SITE_HELP'),(14,0,'Before the picks are locked you can see a list of all players and the game match-ups for that week. You can also see the season totals in the far right column. Once the picks have locked, you can access this page and see everyone\'s picks. As game scores are entered, this page will show all correct picks with an orange background and will sort the players list according to the number of correct picks for the week. Please note the scroll bars will allow you to see all the data vertically and horizontally.','What can I get from the Group Picks page?','SITE_HELP'),(15,0,'Use this page to change your name, email address (username) and password. You can put anything for your name but your username and password are used to log in to the site. Please make note of those. You can also have your username and password emailed to you by going here','What is the Account page for?','SITE_HELP'),(16,0,'','','POT_RULES');
